def shortest_uncommon_subsequence(S: str, T: str) -> int:
    m = len(S)
    n = len(T)
    dp = [[0] * (n + 1) for _ in range(m + 1)]
    for i in range(n + 1):
        dp[0][i] = 501
    for i in range(1, m + 1):
        dp[i][0] = 1
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            k = j - 1
            ch = S[i - 1]
            while k >= 0 and T[k] != ch:
                k -= 1
            if k == -1:
                dp[i][j] = 1
            else:
                dp[i][j] = min(dp[i - 1][j], 1 + dp[i - 1][k])
    ans = dp[m][n]
    if ans > 501:
        ans = -1
    return ans

